messages__text:
Явка избирателей на досрочное голосование по областям и столице такая:

📍Гомельская область — 54,44%;

📍Могилевская область — 49,92%;

📍Брестская область — 38,4%;

📍Витебская область — 39,34%;

📍Гродненская область — 38,6%;

📍Минская область — 39,66%;

📍Минск — 33,4%.

По итогу вчерашних протестов СК возбудил 21 уголовное дело. По следующим статьям УК:

✏️ ст.293 (массовые беспорядки);

✏️ ч.2 ст.363 (сопротивление сотруднику органов внутренних дел,  сопряженное с применением насилия или угрозой его применения);

✏️ ст.364 (насилие либо угроза применения насилия в отношении сотрудника органов внутренних дел);
ч.1 ст.339 (хулиганство);

✏️ ст.342 (организация и подготовка действий, грубо нарушающих общественный порядок, либо активное участие в них).

Задержаны более 80 человек. Большинство их них — молодые люди в возрасте 20-25 лет.

Координационный совет выбрал президиум. В него вошли:

📍Светлана Алексиевич;

📍Лилия Власова;

📍Сергей Дылевский;

📍Максим Знак;

📍Ольга Ковалькова;

📍Мария Колесникова;

📍Павел Латушко.

Министр иностранных дел РФ Сергей Лавров сделал заявление по итогам встречи с замгоссекретаря США Биганом, сообщает

Главное по РБ:

📍белорусы должны сами определить, кто будет участвовать в нацдиалоге;

📍навязанных извне посредников между белорусскими властями и народом, как и любого внешнего вмешательства, быть не должно;

📍оппозицией сейчас руководят с Запада;

📍РФ хочет понять, на каких условиях формировался оппозиционный Координационный совет;

📍Запад должен поддерживать позитивные тенденции в РБ, когда все мирно и без провокаций;

📍причин для антироссийских настроений в РБ нет;

📍санкции и политическое давление на Минск недопустимы

Светлана Тихановская по видеосвязи выступила с докладом перед Советом Безопасности ООН.  Встреча была инициирована Эстонией и организована членами Совета Безопасности из США, Великобритании, Канады, Дании, Исландии, Латвии, Литвы, Польши, Румынии и Украины.

Вот к чему Тихановская призвала ООН:

📍осудить чрезмерное применение силы белорусскими спецслужбами в отношении протестующих;

📍созвать специальное заседание Совета ООН по правам человека для обсуждения ситуации с правами человека в Беларуси;

📍незамедлительно направить в Беларусь международную мониторинговую миссию для документирования ситуации на местах.

:

👉 отставка гендиректора;

👉 освобождение задержанных стачкомовцев «Беларуськалия»;

👉 прекращение давления на членов стачкома и их семьи;

👉 отмена решения об увольнении бастующих работников «Беларуськалия»;

👉 прекращение «беспредела силовиков».

Хроника субботы: 

👉 "Забег свободных" в парке Дружбы народов разогнала милиция. Сообщается минимум о двух задержанных;

👉 Около 9:30 выпустили на свободу главного редактора «Нашай Нівы» Егора Мартиновича. Его задержали по статье 188 УК РБ «Клевета». Пострадавший — заместитель министра внутренних дел Барсуков, которого диджей Соколов в статье на «Нашай Ніве» обвинил в избиении на Окрестина; 

👉 Перед выходными города Беларуси снова "по-партизански" украсились БЧБ-символикой и протестным артом.
